.classifi {

  font-family: "Helvetica Neue", Helvetica, "PingFang SC", "Hiragino Sans GB", "Microsoft YaHei", "微软雅黑", Arial, sans-serif;

  box-shadow: 0 2px 12px 0 rgba(0, 0, 0, 0.1);
  margin: 20px;
  padding: 20px;
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  .classifi-list {
    border: 1px solid #DCDFE6;
    width: 20%;
    min-height: 400px;
    position: relative;
    margin-right: 30px;

    .md {
      font-size: 14px;
      .active {
        background: #C0C4CC;

      }
      .field_title {
        width: 70%;
      }
      .drag-item {
        display: flex;
        flex-direction: row;
        justify-content: space-between;
        padding: 10px;
        align-items: center;
      }
    }

    .add-btn {
      width: 100%;
      position: absolute;
      bottom: 20px;
      text-align: center;
      .primary {
        color: #409EFF;
        border: 1px solid #409EFF;
        font-size: 10px;
        padding: 5px;
        padding-left: 10px;
        padding-right: 10px;
      }
    }
  }
}
